INSERT INTO `think_data` VALUES (2072,'127.0.0.1',394,NULL,111,0,'发个说说',0,1,'127.0.0.1','c7ihudnqcpm3ls69qpc6tukbj3',NULL,NULL,1532257622,1532257622),(2073,'127.0.0.1',394,NULL,111,0,'学习tp5中',0,1,'127.0.0.1','c7ihudnqcpm3ls69qpc6tukbj3',NULL,NULL,1532257641,1532257641),(2074,'127.0.0.1',394,NULL,111,0,'我来学习了',0,1,'127.0.0.1','c7ihudnqcpm3ls69qpc6tukbj3',NULL,NULL,1532259047,1532259047),(2075,'127.0.0.1',394,NULL,111,0,'我们一定要给自己提出这样的任务：第一，学习，第二是学习，第三还是学习。',0,1,'127.0.0.1','c7ihudnqcpm3ls69qpc6tukbj3',NULL,NULL,1532259280,1532259280),(2076,'127.0.0.1',394,NULL,111,0,'书山有路勤为径,学海无涯苦作舟。',0,1,'127.0.0.1','c7ihudnqcpm3ls69qpc6tukbj3',NULL,NULL,1532259309,1532259309),(2077,'127.0.0.1',394,NULL,111,0,'不渴望能够一跃千里,只希望每天能够前进一步。',0,1,'127.0.0.1','c7ihudnqcpm3ls69qpc6tukbj3',NULL,NULL,1532259322,1532259322),(2078,'127.0.0.1',394,NULL,43,0,'1',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342446,1532342446),(2079,'127.0.0.1',394,NULL,43,0,'2',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342448,1532342448),(2080,'127.0.0.1',394,NULL,43,0,'3',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342450,1532342450),(2081,'127.0.0.1',394,NULL,43,0,'4',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342454,1532342454),(2082,'127.0.0.1',394,NULL,43,0,'5',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342456,1532342456),(2083,'127.0.0.1',394,NULL,43,0,'6',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342458,1532342458),(2084,'127.0.0.1',394,NULL,43,0,'65',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342459,1532342459),(2085,'127.0.0.1',394,NULL,43,0,'65',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342461,1532342461),(2086,'127.0.0.1',394,NULL,43,0,'学习知识要善于思考，思考，再思考',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342563,1532342563),(2087,'127.0.0.1',394,NULL,43,0,'在寻求真理的长河中，唯有学习，不断地学习，勤奋地学习，有创造性地学习，才能越重山跨峻岭。',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342578,1532342578),(2088,'127.0.0.1',394,NULL,43,0,'我们全都要从前辈和同辈学习到一些东西。就连最大的天才，如果想单凭他所特有的内在自我去对付一切，他也决不会有多大成就。',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342589,1532342589),(2089,'127.0.0.1',394,NULL,43,0,'现在，我怕的并不是那艰苦严峻的生活，而是不能再学习和认识我迫切想了解的世界。对我来说，不学习，毋宁死。',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342602,1532342602),(2090,'127.0.0.1',394,NULL,43,0,'人的天才只是火花，要想使它成熊熊火焰，哪就只有学习！学习。',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342616,1532342616),(2091,'127.0.0.1',394,NULL,43,0,'只要愿意学习，就一定能够学会',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342625,1532342625),(2092,'127.0.0.1',394,NULL,43,0,'天才不能使人不必工作，不能代替劳动。要发展天才，必须长时间地学习和高度紧张地工作。人越有天才，他面临的任务也就越复杂，越重要。',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342632,1532342632),(2093,'127.0.0.1',394,NULL,43,0,'谁在装束和发型上用尽心思，谁就没有精力用于学习；谁只注意修饰外表的美丽，谁就无法得到内在的美丽。',0,1,'127.0.0.1','1gg5se310kk4ho53sl9vvi4or4',NULL,NULL,1532342652,1532342652),(2185,'30',393,NULL,46,0,'第一个',0,1,'30','eejn4jjqad2u0pjdve2dat8tp1',NULL,NULL,1534665844,1534665844),(2186,'30',393,NULL,46,0,'第二个',2185,1,'30','eejn4jjqad2u0pjdve2dat8tp1',NULL,NULL,1534665992,1534665992),(2187,'30',393,NULL,46,0,'第三个',2186,1,'30','eejn4jjqad2u0pjdve2dat8tp1',NULL,NULL,1534665999,1534665999),(2188,'30',393,NULL,46,0,'第四个',2187,1,'30','eejn4jjqad2u0pjdve2dat8tp1',NULL,NULL,1534666006,1534666006),(2189,'30',393,NULL,46,0,'我也是回复的第二个',2185,1,'30','eejn4jjqad2u0pjdve2dat8tp1',NULL,NULL,1534666622,1534666622),(2190,'30',394,NULL,46,0,'天才不能使人不必工作，不能代替劳动。要发展天才，必须长时间地学习和高度紧张地工作。人越有天才，他面临的任务也就越复杂，越重要',0,1,'30','k2jgrag15p0a8tdfsaq9dmd3v4',NULL,NULL,1534752562,1534752562),(2191,'30',394,NULL,46,0,'儿童的心灵是敏感的，它是为着接受一切好的东西而敞开的。如果教师诱导儿童学习好榜样，鼓励仿效一切好的行为，那末，儿童身上的所有缺点就会没有痛苦和创伤地不觉得难受地逐渐消失。',0,1,'30','k2jgrag15p0a8tdfsaq9dmd3v4',NULL,NULL,1534752606,1534752606),(2192,'30',393,NULL,0,0,'666',0,1,'30',NULL,NULL,NULL,1534846370,1534846370),(2193,'30',393,NULL,0,0,'888',0,1,'30',NULL,NULL,NULL,1534846379,1534846379),(2194,'30',393,NULL,155,0,''